//App.js
import React, { useEffect } from "react";
import './App.css';
import Login from "./components/Login";
import Salir from "./components/Salir";
import Home from "./Vistas/Home";
import Usuarios from "./Vistas/Usuarios";
import Libros from "./Vistas/Libros";
import Menu_usuario from "./components/Menu_usuario";
import Permisos from "./Vistas/Permisos";
import {
    BrowserRouter as Router,
    Route,
    Link,
    Routes,
    Outlet,
} from "react-router-dom";

import { Navbar, Nav } from "react-bootstrap";
import { Toaster } from 'react-hot-toast';

function NotFound() {
    return (
        <div>
            <h2>No se pudo encontrar la pagina</h2>
            <p>Lo sentimos, la seccion que estas tratando de cargar no existe.</p>
        </div>
    );
}


function App() {
    useEffect(() => {
        document.title = 'LibroWiki';
    }, []);
    return (
        <Router>
            <Navbar bg="dark" expand="lg">
                <Navbar.Brand>
                    <h1 className="ml-3 text-green">LibroWiki</h1>
                </Navbar.Brand>
                <Toaster
                    position="bottom-right"
                    reverseOrder={false}
                />
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link className="text-white" as={Link} to="/Home" exact>
                            Inicio
                        </Nav.Link>
                        {Menu_usuario()}
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

            <div className="container mt-4">
                <Routes>
                    <Route path="/" element={<Outlet />}>
                        <Route path="/" element={<Home />} />
                        <Route path="/Home" element={<Home />} />
                        <Route path="/Salir" element={<Salir />} />
                        <Route path="/Libros" element={<Libros />} />
                        <Route path="/Usuarios" element={<Usuarios />} />
                        <Route path="/Permisos" element={<Permisos />} />
                        <Route path="/Login" element={<Login />} />
                        <Route path="*" element={<NotFound />} />
                    </Route>
                </Routes>
            </div>
            <Navbar className="footer" bg="dark" expand="lg">
                <Navbar.Brand>
                    <h2 className="ml-3 text-green" >Tp de Elizabeth Denett</h2>
                </Navbar.Brand>
            </Navbar>
        </Router>

    );

}
export default App;
